INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "あたしだって\nやるときはやるよ！", 0.0, "2020/04/30 12:00:00", 1, 1, 24001, 0, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, "2020/04/30 12:00:00", 1, 1, 24002, 1, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, "2020/04/30 12:00:00", 1, 1, 24003, 2, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "やったね！\nこれでようやく\nサボれるよ…", 0.0, "2020/04/30 12:00:00", 2, 2, 24004, 3, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, "2020/04/30 12:00:00", 1, 1, 24005, 4, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, "2020/04/30 12:00:00", 2, 2, 24006, 5, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "あたしも意外と\nやるもんでしょ？", 0.0, "2020/04/30 12:00:00", 2, 2, 24007, 6, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, "2020/04/30 12:00:00", 4, 4, 24008, 7, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, "2020/04/30 12:00:00", 4, 4, 24009, 8, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "まじめに\nやったんだけどな…\n悔しいな～", 0.0, "2020/04/30 12:00:00", 4, 4, 24010, 9, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "やられた…\nねずみって意外と\nてごわいね", 0.0, "2020/04/30 12:00:00", 4, 4, 24011, 10, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 0.0, 0.0, "2030/12/17 14:59:59", "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, "2020/04/30 12:00:00", 4, 4, 24012, 11, 10040, 24);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (102601, "リン", 1.81, 0.0, "2030/12/17 14:59:59", "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, "2020/04/30 12:00:00", 1, 4, 24013, 12, 10040, 24);
